package cs6301.g32.SP4;

import java.math.BigInteger;
import java.util.Scanner;

/**
 *
 * @author Mohanakrishna,Vinaya,Nikita,Pradeep
 */
public class Fibonacci {
    
    /**
     *   Fibonacci of number using linearFibonacci function
     *  Running Time : O(n)
     * @param n : the nth term till which we need to compute the Fibonacci series
     * @return nth Fibonacci number
     */
    static BigInteger linearFibonacci(int n){
        if(n<0){
            throw new IllegalArgumentException("n value can't be negative");
        }
        
        BigInteger Fib[]=new BigInteger[n+1];
        Fib[0] = new BigInteger("0");
        Fib[1]= new BigInteger("1");
        
        int  i;
        for( i=2; i<=n;i++){
            Fib[i]=Fib[i-1].add(Fib[i-2]);
        }
        
        return Fib[n];
    }
    
     /** 
      * 
      * @param arr1 : 
      * @param n : power of the matrix
      */
     static void power(BigInteger arr1[][], int n){
        BigInteger arr2[][] = {{BigInteger.ONE, BigInteger.ONE}, {BigInteger.ONE, BigInteger.ZERO}};     
        
        if (n == 0 || n == 1)
            return;
        
        power(arr1, n / 2);
        multiply(arr1, arr1);     
        if (n % 2 != 0)
            multiply(arr1, arr2);
     }
     
     /**
      *  Function to multiply arr1 matrix to arr2 matrix
      * @param arr1 : matrix 1 [2x2]
      * @param arr2 : matrix 2 [2x2]
      */
     static void multiply(BigInteger arr1[][], BigInteger arr2[][]){
         BigInteger a11 = (arr1[0][0].multiply(arr2[0][0])).add(arr1[0][1].multiply(arr2[1][0]));
         BigInteger a12 = (arr1[0][0].multiply(arr2[0][1])).add(arr1[0][1].multiply(arr2[1][1]));
         BigInteger a21 = (arr1[1][0].multiply(arr2[0][0])).add(arr1[1][1].multiply(arr2[1][0]));
         BigInteger a22 = (arr1[1][0].multiply(arr2[0][1])).add(arr1[1][1].multiply(arr2[1][1])); 
         arr1[0][0] = a11;
         arr1[0][1] = a12;
         arr1[1][0] = a21;
         arr1[1][1] = a22;
     }
    
     /**
      *  Fibonacci  of a number using matrix multiplication method
      *  Running Time : O(logn)
      * @param n : the nth term till which we need to compute the Fibonacci series
      * @return  : nth Fibonacci number
      */
    static BigInteger logFibonacci(int n){
        BigInteger arr1[][] = {{BigInteger.ONE,BigInteger.ONE},{BigInteger.ONE,BigInteger.ZERO}};
        BigInteger edgeResult;
        
        if(n<0){
            throw new IllegalArgumentException("n value can't be negative");
        }
        
        else if(n==0){
            edgeResult = new BigInteger("0");
            return edgeResult;
        }
        
        else{
            power(arr1,n-1);
            return arr1[0][0];
        }
        
    }
    
    public static void main(String[] args){
        Scanner in = new Scanner(System.in);
        int number = in.nextInt();
        
        //Fibonacci number using linearFibonacci function
        Timer t= new Timer();
        t.start();
        BigInteger linearResult = linearFibonacci(number);
        t.end();
        System.out.println("Result of  linear Fibonacci:"+linearResult);
        System.out.println(t.toString());
        
        //Fibonacci number using logFibonacci function
        t.start();
        BigInteger logResult = logFibonacci(number);
        t.end();
        System.out.println("Result of  log Fibonacci:"+logResult);
        System.out.println(t.toString());
        
    }
    
}

